import React from "react";

function OperationBox(props){
    const isClicked =props.boolean
    return(
        <div onClick={() => {
            props.onChecked(props.id);
          }}>
            <button className={isClicked ? 'isSelected operation' : 'operation'}>
                {props.text}
            </button>
            </div>
    );
}

export default OperationBox;
